import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import {rick1} from '../img/rick1.j';


function Home() {
  return (
    <Carousel>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src={rick1}
          alt="First slide"
        />
      </Carousel.Item>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src={rick2}
          alt="Second slide"
        />
      </Carousel.Item>
      <Carousel.Item Interval={1000}>
        <img
          className="d-block w-100"
          src={rick3}
          alt="Third slide"
        />
      </Carousel.Item>
    </Carousel>
  );
}


export default Home;
